O PRESENTE INSTRUMENTO TEM POR OBJETO A DELEGAÇÃO DAS ATRIBUIÇÕES DE AUTORIDADE DE TRÂNSITO PREVISTAS NO ART. 20, DA LEI Nº 9.503, DE 23 DE SETEMBRO DE 1997, À AUTORIDADE DELEGADA, PARA FISCALIZAÇÃO DAS NORMAS DE TRÂNSITO NOS TRECHOS EM QUE A NATUREZA DO TRÁFEGO SEJA SIMILAR À DE PERÍMETRO URBANO, SEM PREJUÍZO DA ATUAÇÃO CONCORRENTE DA AUTORIDADE DELEGANTE, E NOS TERMOS DA LEGISLAÇÃO DE TRÂNSITO VIGENTE, INCLUINDO, E SEM PREJUÍZO DE OUTRAS, AS SEGUINTES ATIVIDADES:
1.1.1. INSTALAÇÃO E OPERAÇÃO DE EQUIPAMENTOS FIXOS AUTOMÁTICOS DESTINADOS À FISCALIZAÇÃO ELETRÔNICA DE AVANÇO DE SINAL VERMELHO DE SEMÁFORO, DE PARADA IRREGULAR SOBRE FAIXA DE PEDESTRE E DE VELOCIDADE EM RODOVIAS FEDERAIS, EXCETO REDUTOR DE VELOCIDADE;
1.1.2. SUSPENSÃO, CANCELAMENTO E REATIVAÇÃO DE AUTOS DE INFRAÇÃO;
1.1.3. JULGAMENTO DE DEFESAS DE AUTUAÇÃO E DE RECURSOS DE MULTA;
1.1.4. EXPEDIÇÃO DA NOTIFICAÇÃO DA AUTUAÇÃO, IMPOSIÇÃO DA PENALIDADE DE MULTA, EXPEDIÇÃO DA NOTIFICAÇÃO CORRESPONDENTE E ARRECADAÇÃO DAS MULTAS IMPOSTAS;
1.1.5. REFERENDAMENTO DAS IMAGENS E HOMOLOGAÇÃO DOS AUTOS DE INFRAÇÃO.
1.1.6. FISCALIZAÇÃO E OPERAÇÃO DE TRÂNSITO, POR PARTE DOS AGENTES MUNICIPAIS DE TRÂNSITO, COM APLICAÇÃO DAS PENALIDADES E MEDIDAS ADMINISTRATIVAS PREVISTAS NO CÓDIGO DE TRÂNSITO BRASILEIRO E DEFINIDAS PELO CONTRAN TANTO AS DE COMPETÊNCIA PRÓPRIA DOS ÓRGÃO EXECUTIVOS DE TRÂNSITO DOS MUNICÍPIOS QUANTO AS DE COMPETÊNCIA DO ÓRGÃO OU ENTIDADE DE TRÂNSITO RODOVIÁRIO.
1.2. O PRESENTE ACORDO TEM COMO OBJETO O TRECHO RODOVIÁRIO LOCALIZADO ENTRE OS KM 170,3 AO KM 182,1, DA BR 376, RODOVIA FEDERAL FISCALIZADA PELA SUPERINTENDÊNCIA DA POLÍCIA RODOVIÁRIA FEDERAL NO PARANÁ.
1.3. O PRESENTE ACORDO NÃO IMPLICA TRANSFERÊNCIA DE RECURSOS ENTRE AS PARTES.

CONTRATAÇÃO DE EMPRESAS ESPECIALIZADAS NA PRESTAÇÃO DE SERVIÇOS DE TECNOLOGIA DA INFORMAÇÃO, PARA ATENDER NECESSIDADES DO CONSELHO NACIONAL DE DESENVOLVIMENTO CIENTÍFICO E TECNOLÓGICO (CNPQ), CONFORME DISCRIMINADO A SEGUIR:
